import axios from "axios";
import React, {useState} from "react";
import { toast } from "react-toastify";
function ReportDonation(){
    const [data, setData] = useState([])
   const generate = ()=>{
    axios.get('http://localhost:3001/api/Blood/report').then((response)=>{

        if(response.data.error){
            toast.error(response.data.error)
        }else{
            console.log('generate report');
            console.log(response.data);
            setData(response.data)
        }
    })

   }

    return (

        <div>        
        <div id="main1">
            <div id="heading">
                <h1 >Report</h1>
            </div>
            <button id="btn-del" onClick={generate}><h3>Find</h3></button>
            
            </div>
        {
            requestList.map((val,key)=>{
                return (
                    
                    <div className="requests">
                        
                        <div>
                            <div className="main">
                            <h1>Cnic : {val.cnic}</h1>
                            <h1 id="reqid">Requirement id: {val.req_id}</h1>
                            
                            </div>
                            <h3>Blood Group: {val.bloodGroup}</h3>
                            <h3>Quantity Needed: {val.Qtyneed}</h3>
                            <h3>Posted At: {val.Date}</h3>
                            <h3>Time: {val.Time}</h3>
                            <h3>Reason: {val.Reason}</h3>
                            <h3>Time Period : {val.TimePeriod}</h3>
                            <button id="btn-del">Donate</button>


                        </div>

                    </div>
                );
            })
        }
       
       
        </div>


    

    );


}

export default ReportDonation;
